
CREATE SCHEMA [aud]
    AUTHORIZATION [dbo];


CREATE TABLE aud.AuditResults
  (  id BIGINT IDENTITY(1,1) NOT NULL PRIMARY KEY
,ExecId INT NOT NULL
    ,AuditDate DATETIME NOT NULL
,obj_group       NVARCHAR(150) NULL
    ,ds_name_source  NVARCHAR(150) NULL
,SchemaName NVARCHAR(128) NULL
,TableName NVARCHAR(128) NULL
,Descr NVARCHAR(250)  NULL
,SourceRows INT NULL
,DWHRows INT NULL
,DiffRows INT NULL
,PassedIndicator BIT NULL
,ExecutionFailureIndicator BIT NULL
  )
GO

create FUNCTION [aud].[fn_AuditResults_on_Date]
(
@onDate DATE = NULL  
)

RETURNS @AuditResults TABLE (AuditDate datetime
 ,obj_group       NVARCHAR(150) NULL
 ,ds_name_source  NVARCHAR(150) NULL
 ,SchemaName NVARCHAR(128) NULL
 ,TableName NVARCHAR(128) NULL
 ,Descr nvarchar(250)
 ,SourceRows INT
 ,DWHRows INT
 ,DiffRows INT
 ,PassedIndicator  bit
 ,MaxAuditDate datetime
 ,MinAuditDate datetime
 ,AnotherResultMaxDate datetime
 ,SameResultDaysCnt int
 )

AS

begin
 IF @onDate IS NULL BEGIN
        SET @onDate = GETDATE();
    END;


WITH d AS (
SELECT AuditDate
 ,obj_group      
 ,ds_name_source  
 ,SchemaName
 ,TableName
 ,Descr
 ,SourceRows
 ,DWHRows
 ,DiffRows
 ,PassedIndicator
 ,MaxAuditDate = MAX(AuditDate) OVER(PARTITION BY obj_group, ds_name_source, SchemaName, TableName, PassedIndicator)
 ,MinAuditDate = MIN(AuditDate) OVER(PARTITION BY obj_group, ds_name_source, SchemaName, TableName, PassedIndicator)
 ,rn = ROW_NUMBER() OVER(PARTITION BY obj_group, ds_name_source, SchemaName, TableName, PassedIndicator ORDER BY AuditDate DESC)
FROM aud.AuditResults
where cast (AuditDate as date) <= isnull(@onDate,getdate()) )

,d2 AS (
SELECT thisResult.AuditDate
    ,thisResult.obj_group      
    ,thisResult.ds_name_source  
    ,thisResult.SchemaName
    ,thisResult.TableName
,thisResult.Descr
,thisResult.SourceRows
,thisResult.DWHRows
,thisResult.DiffRows
,thisResult.PassedIndicator
,ThisResultMaxDate = thisResult.MaxAuditDate
,ThisResultMinDate = thisResult.MinAuditDate
,AnotherResultMaxDate = anotherResult.MaxAuditDate
,rn2 = ROW_NUMBER() OVER(PARTITION BY  thisResult.obj_group      
     ,thisResult.ds_name_source  
     ,thisResult.SchemaName
     ,thisResult.TableName
ORDER BY thisResult.AuditDate DESC)
FROM d AS thisResult
LEFT JOIN d AS anotherResult
ON      thisResult.obj_group        = anotherResult.obj_group
AND thisResult.ds_name_source   = anotherResult.ds_name_source
AND thisResult.SchemaName = anotherResult.SchemaName
AND thisResult.TableName = anotherResult.TableName
AND thisResult.rn = anotherResult.rn
AND thisResult.PassedIndicator <> anotherResult.PassedIndicator
WHERE thisResult.rn = 1
)

SELECT
AuditDate
,obj_group
,ds_name_source
,SchemaName
,TableName
,Descr
,SourceRows
,DWHRows
,DiffRows
,PassedIndicator
,ThisResultMaxDate
,ThisResultMinDate
,AnotherResultMaxDate
,SameResultDaysCnt =  DATEDIFF(DAY, ISNULL(AnotherResultMaxDate, ThisResultMinDate), ThisResultMaxDate)
FROM d2
WHERE rn2 = 1;

RETURN;

end;







